import React from "react";
import './css/blog.css';


export default function blog(props){

    return <div className="blog-wrap">
        <img src="https://placeimg.com/640/480/nature" alt=""/>
        <p>Tanggal Blog</p>
        <p>Judul Blog</p>
        <p>Summery Blog</p>
    </div>
}
